import React, { useState } from 'react';
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

const CampComponent = () => {
  const [campId, setCampId] = useState('');
  const [donorName, setDonorName] = useState('');
  const [bloodGroup, setBloodGroup] = useState('');
  const [donationDate, setDonationDate] = useState('');
  const [donationTime, setDonationTime] = useState('');
  const [bloodUnit, setBloodUnit] = useState('');
  const [donationId, setDonationId] = useState('');

  const displayResult = (message, type = 'success') => {
    toast[type](message);
    setResult(message);
  };

  const handleGetDonations = async () => {
    try {
      const response = await fetch(`/camp/${campId}/donations`);
      const data = await response.json();
      displayResult(JSON.stringify(data));
    } catch (error) {
      console.error(error);
      displayResult('Error fetching donations', 'error');
    }
  };

  const handleCollectDonation = async () => {
    try {
      const response = await fetch(`/camp/collect/${campId}`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          donorName,
          bloodGroup,
          donationDate,
          donationTime,
          bloodUnit,
        }),
      });
      const data = await response.json();
      console.log(data); // Handle data as needed
    } catch (error) {
      console.error(error);
      displayResult('Error fetching donations', 'error');
    }
  };

  const handleUpdateDonation = async () => {
    try {
      const response = await fetch(`/camp/${campId}/donations/${donationId}`, {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          donorName,
          bloodGroup,
          donationDate,
          donationTime,
          bloodUnit,
        }),
      });
      const data = await response.json();
      console.log(data); // Handle data as needed
    } catch (error) {
      console.error(error);
    }
  };

  const handleDeleteDonation = async () => {
    try {
      const response = await fetch(`/camp/${campId}/donations/${donationId}`, {
        method: 'DELETE',
      });
      const data = await response.json();
      console.log(data); // Handle data as needed
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div className="max-w-2xl mx-auto p-8 bg-white shadow-md">
      <form className="flex flex-col space-y-4">
        <label className="mb-2">
          Camp ID:
          <input
            type="text"
            value={campId}
            onChange={(e) => setCampId(e.target.value)}
            className="p-2 border border-gray-300 rounded"
          />
        </label>
        <label className="mb-2">
  Donor Name:
  <input
    type="text"
    value={donorName}
    onChange={(e) => setDonorName(e.target.value)}
    className="p-2 border border-gray-300 rounded"
  />
</label>

<label className="mb-2">
  Blood Group:
  <input
    type="text"
    value={bloodGroup}
    onChange={(e) => setBloodGroup(e.target.value)}
    className="p-2 border border-gray-300 rounded"
  />
</label>

<label className="mb-2">
  Donation Date:
  <input
    type="text"
    value={donationDate}
    onChange={(e) => setDonationDate(e.target.value)}
    className="p-2 border border-gray-300 rounded"
  />
</label>

<label className="mb-2">
  Donation Time:
  <input
    type="text"
    value={donationTime}
    onChange={(e) => setDonationTime(e.target.value)}
    className="p-2 border border-gray-300 rounded"
  />
</label>

<label className="mb-2">
  Blood Unit:
  <input
    type="text"
    value={bloodUnit}
    onChange={(e) => setBloodUnit(e.target.value)}
    className="p-2 border border-gray-300 rounded"
  />
</label>

<label className="mb-2">
  Donation ID (for update and delete operations):
  <input
    type="text"
    value={donationId}
    onChange={(e) => setDonationId(e.target.value)}
    className="p-2 border border-gray-300 rounded"
  />
</label>

        <div className="flex space-x-4">
          <button onClick={handleGetDonations} className="bg-blue-500 text-white p-2 rounded">
            Get Donations
          </button>
          <button onClick={handleCollectDonation} className="bg-green-500 text-white p-2 rounded">
            Collect Donation
          </button>
          <button onClick={handleUpdateDonation} className="bg-yellow-500 text-white p-2 rounded">
            Update Donation
          </button>
          <button onClick={handleDeleteDonation} className="bg-red-500 text-white p-2 rounded">
            Delete Donation
          </button>
        </div>
      </form>
      <div className="mt-8">
  {result && (
    <div className="bg-gray-100 p-4 rounded">
      <p className="mb-2">{result}</p>
      <div className="flex space-x-4">
        <button onClick={handleUpdateResult} className="bg-yellow-500 text-white p-2 rounded">
          Update Result
        </button>
        <button onClick={handleDeleteResult} className="bg-red-500 text-white p-2 rounded">
          Delete Result
        </button>
      </div>
    </div>
  )}
</div>
</div>

  );
};

export default CampComponent;
